import React from 'react'
import Sticker from '../../components/Main/Auction/Sticker'
function Auctions(){

  const stickList = 
    <li><Sticker index={item}/></li>
    
  return(
    
    <ul>{stickList}</ul>
  )
}

export default Auctions
